import styles from './Button.module.scss';

interface NextStepButtonProps {
  onClick: () => void;
}

const NextStepButton = ({ onClick }: NextStepButtonProps) => {
  return (
    <button className={`${styles.nextStepButton} ${styles.stepsNavButtons}`} onClick={onClick}>
      Next Step
      <FaArrowRightLong />
    </button>
  );
};

export default NextStepButton;
